import styled from 'styled-components';

const Title = styled.h2`
  width: 95%;
  font-size: 2.4rem;
  line-height: 1.2;
  margin-bottom: 30px;
  padding: 8px 0;
`;
const LoginButtonBox = styled.div`
  position: 'absolute',
  bottom: 0,
  marginBottom: 135,
  display: 'flex',
  flexDirection: 'column',
  zIndex: 9999,
  `;

const LoginButton = styled.button`
  width: 100%;
  background: #f7f5ff;
  color: #3a00e5;
  border-color: #3a00e5;
  margin-bottom: 16px;
  &:hover {
    background: #e7e4f2;
`;

export { Title, LoginButtonBox, LoginButton };
